// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21; // Updated to match your compiler version

contract IdentityVerification {
    struct User {
        string username;
        string idHash;
        string passwordHash;
        address walletAddress;
    }

    mapping(address => User) public users;
    mapping(string => address) private _usernameToAddress; // Made private for better encapsulation

    event UserRegistered(address indexed userAddress, string username);

    // Added input validation and gas optimizations
    function registerUser(
        string calldata _username,
        string calldata _idHash,
        string calldata _passwordHash
    ) external {
        require(bytes(_username).length > 0, "Username cannot be empty");
        require(bytes(_idHash).length == 64, "Invalid ID hash length"); // Assuming SHA-256 hash
        require(bytes(_passwordHash).length == 64, "Invalid password hash length");
        require(users[msg.sender].walletAddress == address(0), "User already registered");
        require(_usernameToAddress[_username] == address(0), "Username already taken");

        users[msg.sender] = User({
            username: _username,
            idHash: _idHash,
            passwordHash: _passwordHash,
            walletAddress: msg.sender
        });

        _usernameToAddress[_username] = msg.sender;
        emit UserRegistered(msg.sender, _username);
    }

    // Improved with explicit visibility and gas optimizations
    function verifyUser(
        string calldata _username,
        string calldata _passwordHash
    ) external view returns (bool) {
        address userAddress = _usernameToAddress[_username];
        require(userAddress != address(0), "User not found");
        
        User storage user = users[userAddress]; // Using storage instead of memory for efficiency
        return keccak256(abi.encodePacked(user.passwordHash)) == keccak256(abi.encodePacked(_passwordHash));
    }

    // Added input validation
    function getUserByAddress(address _userAddress) external view returns (User memory) {
        require(_userAddress != address(0), "Invalid address");
        require(users[_userAddress].walletAddress != address(0), "User not found");
        return users[_userAddress];
    }

    // Added input validation
    function getAddressByUsername(string calldata _username) external view returns (address) {
        require(bytes(_username).length > 0, "Username cannot be empty");
        address userAddress = _usernameToAddress[_username];
        require(userAddress != address(0), "User not found");
        return userAddress;
    }
}
